import React from "react";
import { Box, makeStyles, withTheme } from "@material-ui/core";
import Grid from '@material-ui/core/Grid';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import classNames from 'classnames'; //css and material ui style
import NavBar from "../NavBar/NavBar";
import classnames from 'classnames';
import "./glitch.css"
import { grey } from "@material-ui/core/colors";
const useStyles = makeStyles((theme) => ({
    root: {
        minWidth: 275,
        marginBottom: 100,
      },
      title: {
        fontSize: 70,
        fontWeight: "900"
      },
      navbar : {
        zIndex: "2 !important"
      },
      overlay: {
        position: 'absolute',
        color: 'white',
        paddingTop: "15px",
        paddingRight: "3px"
     },
     overlay2: {
        position: 'absolute',
        color: 'white',
     },

}));

export default function Home() {


    const classes = useStyles()

    return (
      <div >
            <div style={{
            height: 60,
            backgroundColor: "white",
            position: "relative",
            zIndex: 2
          }}>
            <NavBar className={classnames(classes.navbar)} />
            </div>
        <div id="background">
        <div style={{
            position: "relative",
            zIndex: 1,
            top: -30
          }}>
        <Box align="center"  m="auto" className={classnames(classes.customSign,"rectangle")}
            display="flex"
            justifyContent="center"
            alignItems="center">
                    <Typography align="left"style={{zIndex: "4 !important"}} className={classNames("title-font",classes.title, classes.overlay)} >
                      Simply Pizza .
                    </Typography>
                    <Typography align="left"style={{zIndex: "5 !important"}} className={classNames("shadow", "title-font", classes.title, classes.overlay2)} >
                      Simply Pizza .
                    </Typography>
            </Box>
            </div>
        <Grid
         container
         direction="row"
         alignContent="center"
         alignItems="center"
         wrap="wrap"
         className="brickwall"
         >
            <Grid item xs={12} >
            </Grid>
            <Grid item xs={4} >
            <Card className={classNames(classes.root, classes.custom)} variant="outlined">
                <CardContent className={classes.cardContentContainer}>
                    <Typography align="left" className={classNames(classes.title, "title-font")} >
                     LifeTracker 
                     </Typography>
                    <Typography variant="h6" component="h2" align="left"  className={classNames(classes.subTitle)} color="textSecondary">
                     Helping you take back control of your world.
                    </Typography>
                </CardContent>
            </Card>
            </Grid>
            <Grid item xs={1} ></Grid>
            <Grid item xs={4} >

            </Grid>
            <Grid item xs={1} ></Grid>
      </Grid>

         <div style={{ marginTop: 30 }}>
        <div
          style={{
            height: 20,
            backgroundColor: "lightblue",
            position: "relative",
            top: 0,
            zIndex: 2
          }}
        >
          zIndex - I have a middle zIndex value
        </div>
        <div
          style={{
            height: 20,
            backgroundColor: "yellow",
            position: "relative",
            top: -10,
            zIndex: 3
          }}
        >
          zIndex - I have the highest
        </div>
        <div
          style={{
            height: 50,
            backgroundColor: "lightgreen",
            position: "relative",
            top: -50,
            zIndex: 1
          }}
        >
          zIndex - I have the lowest
        </div>
        </div>
        </div>
      </div>

    );
  }
